import React, { useState } from 'react';
import { StyleSheet, View} from 'react-native';
import {Card, Text, Button} from 'react-native-elements';

export default function Community(props) { //this element has two attributes, name and update

    const [like, setLike] = useState(6); 
    const [dislike, setDislike] = useState(-20);
    const [wlike, setwLike] = useState(30); 
    const [wdislike, setwDislike] = useState(0);
    const [clike, setcLike] = useState(800); 
    const [cdislike, setcDislike] = useState(-6);
    const [nlike, setnLike] = useState(800); 
    const [ndislike, setnDislike] = useState(-6);


	return (
        <View>
      <Card> 
        <Card.Title>@booksrthebst</Card.Title> 
            <Text>Six of Crows is ok, don't really get the hype behind it.</Text>
            <View style={styles.fixToText}>
                <Button title="Like" onPress={() => {
                    setLike(like + 1); //increases the local counter

				}
				}></Button>
                <Text>{like}</Text>

                <Button title="Dislike" onPress={() => {
                    setDislike(dislike - 1)
				}
				}></Button>
                <Text>{dislike}</Text>
            </View>
            </Card>

             <Card> 
        <Card.Title>@Libby'sCorner</Card.Title> 
            <Text>Just finished 'We were liars'...crying and throwing up rn.</Text>
            <View style={styles.fixToText}>
                <Button title="Like" onPress={() => {
                    setwLike(wlike + 1); //increases the local counter

				}
				}></Button>
                <Text>{wlike}</Text>

                <Button title="Dislike" onPress={() => {
                    setwDislike(wdislike - 1)
				}
				}></Button>
                <Text>{wdislike}</Text>
            </View>
            </Card>


             <Card> 
        <Card.Title>@ciara</Card.Title> 
            <Text>Whoever told me Cruel Prince had romance, lets talk.</Text>
            <View style={styles.fixToText}>
                <Button title="Like" onPress={() => {
                    setcLike(clike + 1); //increases the local counter

				}
				}></Button>
                <Text>{clike}</Text>

                <Button title="Dislike" onPress={() => {
                    setcDislike(cdislike - 1)
				}
				}></Button>
                <Text>{cdislike}</Text>
            </View>
            </Card>

            <Card> 
        <Card.Title>@ninalikestoread</Card.Title> 
            <Text>BookTok just recommends the same 4 authors over and over again. </Text>
            <View style={styles.fixToText}>
                <Button title="Like" onPress={() => {
                    setnLike(nlike + 1); //increases the local counter

				}
				}></Button>
                <Text>{nlike}</Text>

                <Button title="Dislike" onPress={() => {
                    setnDislike(ndislike - 1)
				}
				}></Button>
                <Text>{cdislike}</Text>
            </View>
            </Card>

            </View>


);

}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    marginHorizontal: 16,
  },

  fixToText: {
    flexDirection: 'row',
    justifyContent: 'space-between',
  },

});
